import React, { Component } from 'react';

export default class Nav extends Component {
    render() {
        return (
            <nav id="navBar">
        <a href="#Home"><i class="fas fa-home fa-2x" id="FirstIcon" onmouseover="homeText()" onmouseout="blankText()"></i></a>
        <a href="#Me"><i class="fas fa-user-check fa-2x" id="SecondIcon" onmouseover="whoText()" onmouseout="blankText()"></i></a>
        <a href="#myWorks"><i class="fas fa-laptop-code fa-2x" id="ThirdIcon" onmouseover="workText()" onmouseout="blankText()"></i></a>
        <a href="#mySocial"><i class="fas fa-handshake fa-2x" id="FourthIcon" onmouseover="contactText()" onmouseout="blankText()"></i></a>
        <article>
            <h3 class="changingText" id="Change"></h3>
        </article>
    </nav>

        );
    }
}
